2021-03-29 02:09:50	debug	spam  	Spam attempt blocked by module content analyzer. {"attachments":[{"filename":"606136aa10645-CURR\u00cdCULUM Rocio del Pilar.docx","realname":"CURR\u00cdCULUM Rocio del Pilar.docx","size":388047}],"name":"Rocio del Pilar ","textfield2":"Ba\u00f1ez Silva","email":"rocio.silva.4a@gmail.com","textfield1":"662940815","textarea1":"Estimados\/as Se\u00f1ores\/as:\r\n\r\nCon referencia a vuestra oferta para poder aspirar a un puesto de trabajo en vuestra empresa, me dirijo a ustedes con la intenci\u00f3n de ofrecerles mis servicios ya que estoy muy interesada en el puesto.\r\n\r\nDe acuerdo con mi formaci\u00f3n y experiencia profesional, y a pesar de mi juventud me considero perfectamente capacitada para desempe\u00f1ar las funciones propias del puesto que me ofrezc\u00e1is, en este caso, auxiliar de enfermer\u00eda.\r\n\r\nAcompa\u00f1ando la presente, les env\u00edo mi CV, en el que podr\u00e1n observar que, una vez finalizados los estudios del Ciclo Formativo de Grado Medio, he procurado mejorar mi experiencia profesional a trav\u00e9s de otros puestos de trabajo que he realizado en otros lugares, siendo en uno de los lugares en el que trabajo actualmente, aunque me gustar\u00eda aspirar a un puesto de trabajo con el que poder seguir form\u00e1ndome dia a dia y coger a\u00fan m\u00e1s experiencia, adem\u00e1s me gustar\u00eda trabajar con vosotros ya que he o\u00eddo que trabajais con profesionales de verdad y adem\u00e1s que es un sitio en el que me gustar\u00eda estar, no teng\u00e1is en cuenta que trabajo actualmente porque me gustar\u00eda tambi\u00e9n estar cerca de mi familia y poder aspirar a un puesto mejor y m\u00e1s cerca de mi domicilio, tengo disponibilidad absoluta para viajar, adem\u00e1s de especializarme con distintos cursos relacionados con el puesto; por lo que les ruego que tengan en cuenta el CV adjunto.\r\n\r\nEsperando recibir noticias vuestras en breve plazo, les saluda atentamente.\r\n\r\nRoc\u00edo del Pilar Ba\u00f1ez Silva","checkbox1":"S\u00ed","recaptcha":"efc8dee1ea3afae9cdcd28466da26726","userinfo":{"device":{"model":"","vendor":"","type":""},"os":{"name":"Windows","version":10},"browser":{"name":"Firefox","version":"86.0","major":"86"}},"system":{"title":"Env\u00edanos tu CV - Centro Universitario de Enfermer\u00eda San Juan de Dios","uri":"http:\/\/www.cue.sjd.es\/envianos-tu-cv"},"antispam":{"honeypot":"","interaction":"-2264"}}
