442\u043e \u043f\u0440\u0435\u0434\u043b\u043e\u0436\u0438\u0442\u044c, \u0440\u0430\u0441\u0441\u043c\u043e\u0442\u0440\u044e \u043b\u044e\u0431\u044b\u0435 \u0432\u0430\u0440\u0438\u0430\u043d\u0442\u044b. \r\n\u0416\u0430\u043b\u043a\u043e \u0441\u0430\u0439\u0442 \u043f\u0440\u043e\u0441\u0442\u0430\u0438\u0432\u0430\u0435\u0442. \r\n\u041f\u0418\u0428\u0418\u0422\u0415 punisher99@mail.ru, \r\n\u0411\u043e\u043b\u044c\u0448\u043e\u0435 \u0441\u043f\u0430\u0441\u0438\u0431\u043e \u0437\u0430 \u0432\u043d\u0438\u043c\u0430\u043d\u0438\u0435, \u043c\u0435\u043d\u044f \u0437\u043e\u0432\u0443\u0442 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440. \r\n------ \r\nPS(\u0415\u0441\u043b\u0438 \u043a\u043e\u043c\u0443 \u0438\u043d\u0442\u0435\u0440\u0435\u0441\u043d\u043e): \r\n\u0421\u0430\u0439\u0442 \u0441\u0434\u0435\u043b\u0430\u043d \u043d\u0430 \u0434\u0432\u0438\u0436\u043a\u0435 \u041e\u043f\u0435\u043d\u043a\u0430\u0440\u0442 3, \u0430 \u0437\u043d\u0430\u0447\u0438\u0442 \u0441\u043a\u043e\u0440\u043e\u0441\u0442\u044c \u0438 \u0431\u0435\u0437\u043e\u043f\u0430\u0441\u043d\u043e\u0441\u0442\u044c \u0441\u0430\u0439\u0442\u0430 \u043d\u0430 \u0432\u044b\u0441\u043e\u0442\u0435 \u0434\u0430\u0436\u0435 \u043d\u0430 \u0434\u0435\u0448\u0435\u0432\u043e\u043c \u0445\u043e\u0441\u0442\u0438\u043d\u0433\u0435. \r\n\u041e\u043f\u0435\u043d\u043a\u0430\u0440\u0442\u043e\u043c \u0437\u0430\u043d\u0438\u043c\u0430\u043b\u0438\u0441\u044c \u0441\u043e\u0442\u043d\u0438 \u0440\u0430\u0437\u0440\u0430\u0431\u043e\u0442\u0447\u0438\u043a\u043e\u0432 \u043c\u043d\u043e\u0433\u0438\u0435 \u0433\u043e\u0434\u044b \u0438 \u0432\u0441\u0435 \u0432\u0435\u0440\u043e\u044f\u0442\u043d\u043e\u0441\u0442\u0438 \u0431\u0430\u0433\u043e\u0432 \u0438 \u0432\u0437\u043b\u043e\u043c\u043e\u0432 \u0443\u0436\u0435 \u0431\u044b\u043b\u0438 \u0443\u0441\u0442\u0440\u0430\u043d\u0435\u043d\u044b. \r\n\u0421\u0430\u043c\u043e\u043f\u0438\u0441\u043d\u044b\u0435 \u0434\u0432\u0438\u043