0432\u0441\u0435 \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0435 \u043d\u043e\u0440\u043c\u044b \u0438 \u043d\u0435 \u043d\u0430\u0440\u0443\u0448\u0430\u044f \u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u0430? \r\n\u0412\u0437\u0433\u043b\u044f\u0434 \u043d\u0430 \u0432\u0435\u0449\u0438 \u0443 \u043c\u0435\u043d\u044f \u043a\u043e\u043d\u0435\u0447\u043d\u043e \u0436\u0435\u043d\u0441\u043a\u0438\u0439, \u0430 \u043d\u0435 \u043c\u0443\u0436\u0441\u043a\u043e\u0439, \u043c\u043d\u0435 \u0447\u0442\u043e-\u0442\u043e \u043c\u0430\u043b\u043e \u0432 \u044d\u0442\u043e \u0432\u0435\u0440\u0438\u0442\u0441\u044f, \u0432 \u043e\u0431\u0449\u0435\u043c, \u044f \u0441\u043e\u043c\u043d\u0435\u0432\u0430\u044e\u0441\u044c \u0438 \u043a\u043e\u043b\u0435\u0431\u043b\u044e\u0441\u044c. \r\n\u0421\u0430\u0439\u0442 \u0443 \u043d\u0438\u0445 \u043a\u043e\u043d\u0435\u0447\u043d\u043e \u0445\u043e\u0440\u043e\u0448\u0438\u0439 \u0438 \u043f\u043e\u044f\u0441\u043d\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0439, \u0441 \u043c\u043d\u043e\u0436\u0435\u0441\u0442\u0432\u043e\u043c \u0440\u0430\u0437\u044a\u044f\u0441\u043d\u044f\u044e\u0449\u0438\u0445 \u0438 \u043f\u043e\u0434\u0440\u043e\u0431\u043d\u044b\u0445 \u0441\u0442\u0430\u0442\u0435\u0439 \u0441 \u0441\u0445\u0435\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u043c\u0438 \u0440\u0438\u0441\u0443\u043d\u043a\u0430\u043c\u0438 \u0438 \u0442\u0430\u0431\u043b\u0438\u0446\u0430\u043c\u0438, \u043d\u0430\u043f\u0440\u0438\u043c\u0435\u0440: \r\n<a href=https:\/\/prorab2.ru\/fundament\/fundament-pod-garazh\/kakoy-glubiny-dolzhen-byt-fundament-pod-garazh.html>\u041a\u0430\u043a \u0437\u0430\u043b\u0438\u0442\u044c \u0444\u0443\u043d\u0434\u0430\u043c\u0435\u043d\u0442 \u043f\u043e\u0434 \u0433\u0430\u0440\u0430\u0436<\/a> \r\n\u041f\u043e\u0441\u043b\u0435 \u043f\u0440\u043e\u0447\u0442\u0435\u043d\